function VoyPanel() {
  return(
   <div>
      <img className="phone_image" src={"../../static/VoyPhone.png"} alt="Phone with Voy App open"/>
      <div className="content">
        <img className="logo" src={"../../static/VoyLogo.png"} alt="Voy App Logo"/>
        <a><b>Venture-backed</b>audio tour application</a>
      </div>
      <style jsx>{`
        padding-top: 10vh;
        position: absolute;

        .phone_image{
          padding-left: 15vw;
          height: 75vh;
        }
        .content{
          padding-top: 5vh;
          padding-left: 50vw;
        }
        .logo{
          height: 8vh;
        }
        a{
          text-overflow: ellipsis;

 /* Required for text-overflow to do anything */
 white-space: nowrap;
 overflow: hidden;
          padding-top: 20vh;
          font-size: 3.5vh;
        }
      `}</style>
    </div>
  )
}
export default VoyPanel
